import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";

const PendingMealPlans = ({data, numRows}) => {
  const columns = ["Paciente", "Fecha de creación", "Objetivo", "Progreso"]; //ojo con PatientsMain y numcolumnas

  const options = {
    filterType: 'dropdown',
    rowsPerPage: numRows,
    rowsPerPageOptions: [numRows, numRows * 2, numRows * 3],
    textLabels:{
      body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
    },
    filterType: 'dropdown',
    responsive: 'scroll'
  };  


  return(
    <MUIDataTable
      title={['Pacientes']}
      data={data}
      columns={columns}
      options={options}
    />
  )
}

